INSERT INTO themes (theme_id, theme_name, start_time, end_time, theme_time, intervals, theme_desc, difficulty, suitable_players, theme_img, price, start_date, end_date, created_at, last_modified_by, last_modified_at) VALUES
(1, '尋找失落的寶藏', '09:00:00', '10:30:00', '90', '30', '在古老的山洞中尋找失落的寶藏，需要解開謎題才能找到寶藏。', 3, '3~5人', '1.jpg', '500', '2024-05-01', '2025-05-01', '2024-05-15 14:19:56', NULL, '2024-05-15 14:38:13'),
(2, '廢棄的實驗室', '09:00:00', '10:30:00', '90', '30', '在一個被遺棄的實驗室中尋找失踪的科學家和他的實驗。', 4, '4~6人', '7.jpg', '600', '2024-06-01', '2025-06-01', '2024-05-15 14:19:56', NULL, '2024-05-15 14:33:01'),
(3, '進擊的巨人', '09:00:00', '10:00:00', '60', '30', '面對巨型巨人的進擊，找到一個逃脫的方法。', 5, '3~5人', '12.jpg', '700', '2024-07-01', '2025-07-01', '2024-05-15 14:19:56', NULL, '2024-05-15 14:33:23'),
(4, '古堡迷宮', '09:00:00', '10:30:00', '90', '60', '在一個古堡迷宮中找到出口，但要小心不要被怪物吃掉。', 3, '4~6人', '5.jpg', '550', '2024-08-01', '2025-08-01', '2024-05-15 14:19:56', NULL, '2024-05-15 14:33:43'),
(5, '海底之旅', '09:00:00', '10:30:00', '90', '60', '在海底世界中探險，找到失落的寶藏並逃脫。', 4, '5~8人', '4.jpg', '600', '2024-09-01', '2025-09-01', '2024-05-15 14:19:56', NULL, '2024-05-15 14:33:57'),
(6, '未來之城', '09:00:00', '10:30:00', '60', '30', '探索一個科技發達的未來城市，解開它的種種謎題。', 5, '4~6人', '15.jpg', '700', '2024-10-01', '2025-10-01', '2024-05-15 14:19:56', NULL, '2024-05-15 20:26:02'),
(7, '迷失之森', '09:00:00', '10:30:00', '90', '60', '在一片神秘的森林中迷路，找到回家的路。', 3, '3~5人', '6.jpg', '550', '2024-11-01', '2025-11-01', '2024-05-15 14:19:56', NULL, '2024-05-15 15:09:22'),
(8, '幽靈屋', '09:00:00', '10:30:00', '60', '30', '在一間幽靈屋中解開它的魔咒，找到出口。', 4, '5~8人', '6.jpg', '600', '2024-12-01', '2025-12-01', '2024-05-15 14:19:56', NULL, '2024-05-15 14:35:18'),
(9, '星際探險', '09:00:00', '10:30:00', '90', '60', '在太空船上進行一次星際探險，找到失踪的船員和他們的秘密。', 5, '4~6人', '14.jpg', '600', '2025-01-01', '2026-01-01', '2024-05-15 14:19:56', NULL, '2024-05-15 15:09:04'),
(10, '神秘的研究所', '09:00:00', '10:30:00', '90', '30', '在一個神秘的實驗室中尋找脫逃的方法，記住，時間是有限的！', 4, '5~8人', '12.jpg', '600', '2025-02-01', '2026-02-01', '2024-05-15 14:19:56', NULL, '2024-05-15 16:16:55');
